import React from "react";
// import Search from "../Search/Search";
import MenuIcon from "@mui/icons-material/Menu";
import "./Menubar.css";
const Menubar = () => {
  return (
    <>
      {/* <Search /> */}
      <span className="menubarIcon">
        <MenuIcon />
      </span>
      <div className="user">
        <span className="userPhoto">
          <img src="./devImg_bg.png" alt="" />
        </span>
      </div>
    </>
  );
};

export default Menubar;
